		   <script>
      $(function() {
  var dropzone = $('#runUploder');
  var fileInput = $('#fileUploader');

  // عرض اسم الملف عند تحميله باستخدام خاصية drag and drop
  dropzone.on('dragover', function() {
    dropzone.addClass('hover');
    return false;
  });

  dropzone.on('dragleave', function() {
    dropzone.removeClass('hover');
    return false;
  });

  dropzone.on('drop', function(e) {
    e.preventDefault();
    dropzone.removeClass('hover');
    var file = e.originalEvent.dataTransfer.files[0];
    showFileName(file.name);
  });

  // عرض اسم الملف عند تحميله باستخدام زر "Select the file to import"
  fileInput.change(function() {
    var fileName = $(this).val().split("\\").pop();
    showFileName(fileName);
  });

  // دالة عرض اسم الملف
  function showFileName(fileName) {
    var uploadFilename = $('.upload-drag-drop-filename');
    uploadFilename.text(fileName);
  }

  // دالة اختيار الملف باستخدام زر "Select the file to import"
  function selectFileFromButton(button, input) {
    $(input).click();
  }
});
</script>

    
  



